INSERT INTO `v1_d51f6b26fe39713f2fec67fb35da243a29c9c10b1b4254b84c6bfa3fc19547d3` VALUES ("2023/06/30 12:00:00", 126401, 1, 1.47, 0.0, -470.0, 2002, 10001, 1, "2023/09/22 14:59:59", 2, 1, "クローチェ", "いらっしゃいませっ♪\nキャラバンコインを使って\n買い物ができますよっ！");
INSERT INTO `v1_d51f6b26fe39713f2fec67fb35da243a29c9c10b1b4254b84c6bfa3fc19547d3` VALUES ("2023/06/30 12:00:00", 126401, 2, 2.15, 0.0, -470.0, 2002, 10002, 2, "2023/09/22 14:59:59", 1, 1, "クローチェ", "素敵な品が揃ってるので\nたーっくさん買っていって\nくださいねっ♪");
INSERT INTO `v1_d51f6b26fe39713f2fec67fb35da243a29c9c10b1b4254b84c6bfa3fc19547d3` VALUES ("2023/06/30 12:00:00", 126501, 2, 0.0, 0.0, -470.0, 2002, 10003, 1, "2023/09/22 14:59:59", 2, 1, "ライラエル", "ショップへようこそ\nキャラバンコインはこちら\nで買い物に使えますよ");
INSERT INTO `v1_d51f6b26fe39713f2fec67fb35da243a29c9c10b1b4254b84c6bfa3fc19547d3` VALUES ("2023/06/30 12:00:00", 126501, 1, 0.0, 0.0, -470.0, 2002, 10004, 2, "2023/09/22 14:59:59", 1, 1, "ライラエル", "こちらのショップで\n買い物をして、素敵な\n旅を楽しんでくださいね");
INSERT INTO `v1_d51f6b26fe39713f2fec67fb35da243a29c9c10b1b4254b84c6bfa3fc19547d3` VALUES ("2023/09/15 15:00:00", 127702, 2, 0.0, 0.0, -470.0, 2002, 10005, 1, "2023/12/22 14:59:59", 2, 2, "リンド", "いらっしゃいませ\nキャラバンコインを使って\nお買い物ができますよ");
INSERT INTO `v1_d51f6b26fe39713f2fec67fb35da243a29c9c10b1b4254b84c6bfa3fc19547d3` VALUES ("2023/09/15 15:00:00", 127702, 2, 0.0, 0.0, -470.0, 2002, 10006, 2, "2023/12/22 14:59:59", 2, 2, "リンド", "ショップの掃除は完璧です\n姫さま直営のお店として\n当然のことですから");
INSERT INTO `v1_d51f6b26fe39713f2fec67fb35da243a29c9c10b1b4254b84c6bfa3fc19547d3` VALUES ("2023/09/15 15:00:00", 127802, 1, 0.0, 0.0, -470.0, 2002, 10007, 1, "2023/12/22 14:59:59", 1, 2, "ヴルム", "ショップへようこそ\nキャラバンコインと品物を\n交換できるんで、よければ");
INSERT INTO `v1_d51f6b26fe39713f2fec67fb35da243a29c9c10b1b4254b84c6bfa3fc19547d3` VALUES ("2023/09/15 15:00:00", 127802, 2, 6.5, 0.0, -470.0, 2002, 10008, 2, "2023/12/22 14:59:59", 1, 2, "ヴルム", "なんで店番なんか…\nま、やりますけど\n好きな品物をどうぞ");
INSERT INTO `v1_d51f6b26fe39713f2fec67fb35da243a29c9c10b1b4254b84c6bfa3fc19547d3` VALUES ("2023/12/15 15:00:00", 129602, 2, 0.0, 0.0, -470.0, 2002, 10009, 1, "2024/03/22 14:59:59", 1, 3, "アネモネ", "──いらっしゃいませ\n買い物しても、いいですよ\nキャラバンコインがあれば");
INSERT INTO `v1_d51f6b26fe39713f2fec67fb35da243a29c9c10b1b4254b84c6bfa3fc19547d3` VALUES ("2023/12/15 15:00:00", 129602, 2, 0.0, 0.0, -470.0, 2002, 10010, 2, "2024/03/22 14:59:59", 1, 3, "アネモネ", "──もっと笑顔がほしい？\nいくらコインを積まれても\n売れない物はありますから");
INSERT INTO `v1_d51f6b26fe39713f2fec67fb35da243a29c9c10b1b4254b84c6bfa3fc19547d3` VALUES ("2023/12/15 15:00:00", 129701, 1, 0.0, 0.0, -470.0, 2002, 10011, 1, "2024/03/22 14:59:59", 1, 3, "ネフィ=ネラ", "ようこそおいでなんし\nキャラバンコインをこちら\nで交換して進ぜんしょう");
INSERT INTO `v1_d51f6b26fe39713f2fec67fb35da243a29c9c10b1b4254b84c6bfa3fc19547d3` VALUES ("2023/12/15 15:00:00", 129701, 2, 6.2, 0.0, -470.0, 2002, 10012, 2, "2024/03/22 14:59:59", 1, 3, "ネフィ=ネラ", "ところで、お前さまは\nいくらで贖えるのか喃？\n──フフ、冗談でありんす");
INSERT INTO `v1_d51f6b26fe39713f2fec67fb35da243a29c9c10b1b4254b84c6bfa3fc19547d3` VALUES ("2024/03/15 15:00:00", 130301, 3, 3.1, 0.0, -470.0, 2002, 10013, 1, "2024/06/22 14:59:59", 5, 4, "カノン", "い、いらっしゃいませっ！\n…くっ…このあたくし様が\n店番なんて…屈辱ですわっ");
INSERT INTO `v1_d51f6b26fe39713f2fec67fb35da243a29c9c10b1b4254b84c6bfa3fc19547d3` VALUES ("2024/03/15 15:00:00", 130301, 3, 6.15, 0.0, -470.0, 2002, 10014, 2, "2024/06/22 14:59:59", 2, 4, "カノン", "あら、あたくしをご所望？\nお生憎様、そんな小銭では\n…買えちゃうんですの！？");
INSERT INTO `v1_d51f6b26fe39713f2fec67fb35da243a29c9c10b1b4254b84c6bfa3fc19547d3` VALUES ("2024/03/15 15:00:00", 130401, 2, 0.0, 0.0, -470.0, 2002, 10015, 1, "2024/06/22 14:59:59", 2, 4, "ナーナ", "いらっしゃいませ～♪\nきゃらばんこいん？を\n交換できるんだってー");
INSERT INTO `v1_d51f6b26fe39713f2fec67fb35da243a29c9c10b1b4254b84c6bfa3fc19547d3` VALUES ("2024/03/15 15:00:00", 130401, 2, 3.35, 0.0, -470.0, 2002, 10016, 2, "2024/06/22 14:59:59", 1, 4, "ナーナ", "甘いのくれたら、\nお礼にナーナの拾った\n松ぼっくりあげちゃうよ！");
INSERT INTO `v1_d51f6b26fe39713f2fec67fb35da243a29c9c10b1b4254b84c6bfa3fc19547d3` VALUES ("2024/06/15 15:00:00", 130502, 1, 0.0, 0.0, -470.0, 2002, 10017, 1, "2024/09/22 14:59:59", 1, 5, "ホウオウ", "ショップへようこそ\nこの鳳凰が、皆さんに\n祝福を差し上げましょう");
INSERT INTO `v1_d51f6b26fe39713f2fec67fb35da243a29c9c10b1b4254b84c6bfa3fc19547d3` VALUES ("2024/06/15 15:00:00", 130502, 2, 3.18, 0.0, -470.0, 2002, 10018, 2, "2024/09/22 14:59:59", 1, 5, "ホウオウ", "ほーちゃんと呼ぶ権利は\n売っていませんよ？\n騎士さんへの、特別です！");
INSERT INTO `v1_d51f6b26fe39713f2fec67fb35da243a29c9c10b1b4254b84c6bfa3fc19547d3` VALUES ("2024/06/15 15:00:00", 130503, 4, 0.0, 0.0, -470.0, 2002, 10019, 3, "2024/09/22 14:59:59", 4, 5, "ホウオウ", "うﾞぇぇえんっ！まﾞだごの\n格好になっぢゃいまじだ！\n寄付をお願いじまず～っ！");
INSERT INTO `v1_d51f6b26fe39713f2fec67fb35da243a29c9c10b1b4254b84c6bfa3fc19547d3` VALUES ("2024/06/15 15:00:00", 123301, 1, 4.9, 0.0, -470.0, 2002, 10020, 1, "2024/09/22 14:59:59", 2, 5, "ネア", "おっすー♪\nなんでも交換してけー\nカリザきゅん以外で");
INSERT INTO `v1_d51f6b26fe39713f2fec67fb35da243a29c9c10b1b4254b84c6bfa3fc19547d3` VALUES ("2024/06/15 15:00:00", 123301, 1, 4.8, 0.0, -470.0, 2002, 10021, 2, "2024/09/22 14:59:59", 2, 5, "ネア", "ところで、騎士きゅんは\nおいくら万ルピ？\nジョーダンぬ・き・で♡");
INSERT INTO `v1_d51f6b26fe39713f2fec67fb35da243a29c9c10b1b4254b84c6bfa3fc19547d3` VALUES ("2024/09/15 15:00:00", 133301, 3, 4.922, 0.0, -470.0, 2002, 10022, 1, "2024/12/22 14:59:59", 1, 6, "カリザ", "ケッ、なんでオレ様が店番\nなんざ…って来んなキイロ\nオレは売りモンじゃねー！");
INSERT INTO `v1_d51f6b26fe39713f2fec67fb35da243a29c9c10b1b4254b84c6bfa3fc19547d3` VALUES ("2024/09/15 15:00:00", 133301, 3, 9.638, 0.0, -470.0, 2002, 10023, 2, "2024/12/22 14:59:59", 5, 6, "カリザ", "い、言わなきゃダメか？\n「…いらっしゃいませ…」\nクソッ、笑うんじゃねー！");
INSERT INTO `v1_d51f6b26fe39713f2fec67fb35da243a29c9c10b1b4254b84c6bfa3fc19547d3` VALUES ("2024/09/15 15:00:00", 133401, 1, 2.88, 0.0, -470.0, 2002, 10024, 1, "2024/12/22 14:59:59", 2, 6, "ミーア", "ショップへようこそ～\nネラさまの腹心…的な私が\n店番させていただきま～す");
INSERT INTO `v1_d51f6b26fe39713f2fec67fb35da243a29c9c10b1b4254b84c6bfa3fc19547d3` VALUES ("2024/09/15 15:00:00", 133401, 5, 4.818, 0.0, -470.0, 2002, 10025, 2, "2024/12/22 14:59:59", 1, 6, "ミーア", "私の抜け殻とか、\n需要ありますかね～…\nって冗談ですよ、冗談！");
INSERT INTO `v1_d51f6b26fe39713f2fec67fb35da243a29c9c10b1b4254b84c6bfa3fc19547d3` VALUES ("2024/12/15 15:00:00", 133002, 2, 1.78, 0.0, -470.0, 2002, 10026, 1, "2025/03/22 14:59:59", 1, 7, "グレイス", "へい、らっしゃい\nさ、騎士氏。冥土の土産は\nなにがいいですか？");
INSERT INTO `v1_d51f6b26fe39713f2fec67fb35da243a29c9c10b1b4254b84c6bfa3fc19547d3` VALUES ("2024/12/15 15:00:00", 133002, 1, 6.15, 0.0, -470.0, 2002, 10027, 2, "2025/03/22 14:59:59", 7, 7, "グレイス", "商品をお買い上げ毎に\nグレイスちゃんポイントを\n差し上げます。嘘ですが");
INSERT INTO `v1_d51f6b26fe39713f2fec67fb35da243a29c9c10b1b4254b84c6bfa3fc19547d3` VALUES ("2024/12/15 15:00:00", 133102, 6, 4.28, 0.0, -470.0, 2002, 10028, 1, "2025/03/22 14:59:59", 2, 7, "ヴァイオレット", "ようこそいらっしゃいませ\n…接客とは、このような\n振舞で宜しいでしょうか？");
INSERT INTO `v1_d51f6b26fe39713f2fec67fb35da243a29c9c10b1b4254b84c6bfa3fc19547d3` VALUES ("2024/12/15 15:00:00", 133102, 1, 0.0, 0.0, -470.0, 2002, 10029, 2, "2025/03/22 14:59:59", 1, 7, "ヴァイオレット", "じめじめした商品は\nございませんので\n安心してお買い求め下さい");
INSERT INTO `v1_d51f6b26fe39713f2fec67fb35da243a29c9c10b1b4254b84c6bfa3fc19547d3` VALUES ("2025/03/15 15:00:00", 136902, 2, 5.53, 0.0, -470.0, 2002, 10030, 1, "2025/06/23 14:59:59", 1, 8, "ルルィ", "いらっしゃいましぇでしゅ\n何をお求めでしゅか？\nたこ焼きもありましゅよ！");
INSERT INTO `v1_d51f6b26fe39713f2fec67fb35da243a29c9c10b1b4254b84c6bfa3fc19547d3` VALUES ("2025/03/15 15:00:00", 136902, 9, 6.05, 0.0, -470.0, 2002, 10031, 2, "2025/06/23 14:59:59", 7, 8, "ルルィ", "そのコイン…ピカピカで、\n集めたくなっちゃいましゅ\nタコ釣られされちゃう～…");
INSERT INTO `v1_d51f6b26fe39713f2fec67fb35da243a29c9c10b1b4254b84c6bfa3fc19547d3` VALUES ("2025/03/15 15:00:00", 137001, 2, 0.0, 0.0, -470.0, 2002, 10032, 1, "2025/06/23 14:59:59", 1, 8, "デュラン", "姫のご友人ならば\n礼儀を尽くすのが爺の務め\nさ、望みの物を言いたまえ");
INSERT INTO `v1_d51f6b26fe39713f2fec67fb35da243a29c9c10b1b4254b84c6bfa3fc19547d3` VALUES ("2025/03/15 15:00:00", 137001, 2, 0.0, 0.0, -470.0, 2002, 10033, 2, "2025/06/23 14:59:59", 1, 8, "デュラン", "キャラバンコインではなく\n首で支払って貰えんかのぅ\n…冗談であるぞ？");
INSERT INTO `v1_d51f6b26fe39713f2fec67fb35da243a29c9c10b1b4254b84c6bfa3fc19547d3` VALUES ("2025/06/16 15:00:00", 135902, 2, 0.0, 0.0, -470.0, 2002, 10034, 1, "2025/09/23 14:59:59", 2, 9, "サツキ", "おう\n好きなもん持ってきな");
INSERT INTO `v1_d51f6b26fe39713f2fec67fb35da243a29c9c10b1b4254b84c6bfa3fc19547d3` VALUES ("2025/06/16 15:00:00", 135902, 1, 4.935, 0.0, -470.0, 2002, 10035, 2, "2025/09/23 14:59:59", 6, 9, "サツキ", "宵越しの銭を持つような\n野暮いマネぁしくさんな\nツキが落ちてもしらねぇぜ");
INSERT INTO `v1_d51f6b26fe39713f2fec67fb35da243a29c9c10b1b4254b84c6bfa3fc19547d3` VALUES ("2025/06/16 15:00:00", 135802, 2, 7.441, 0.0, -470.0, 2002, 10036, 1, "2025/09/23 14:59:59", 5, 9, "ユキノ", "ら、ら、らっしゃっせ…\nなんかほしいもん、ある？\nか、かき氷とか、ど…？");
INSERT INTO `v1_d51f6b26fe39713f2fec67fb35da243a29c9c10b1b4254b84c6bfa3fc19547d3` VALUES ("2025/06/16 15:00:00", 135802, 7, 0.0, 0.0, -470.0, 2002, 10037, 2, "2025/09/23 14:59:59", 7, 9, "ユキノ", "そ、そんな見ねぇで…\nあては、売りもんじゃ\nねぇよ…？");
INSERT INTO `v1_d51f6b26fe39713f2fec67fb35da243a29c9c10b1b4254b84c6bfa3fc19547d3` VALUES ("2025/09/16 15:00:00", 130901, 2, 2.295, 0.0, -470.0, 2002, 10038, 1, "2025/12/23 14:59:59", 2, 10, "クルル", "クルルをお求めですかっ？\nそれならお礼に、こちらの\n宝石もどうぞですよ～♪");
INSERT INTO `v1_d51f6b26fe39713f2fec67fb35da243a29c9c10b1b4254b84c6bfa3fc19547d3` VALUES ("2025/09/16 15:00:00", 130901, 1, 6.281, 0.0, -470.0, 2002, 10039, 2, "2025/12/23 14:59:59", 6, 10, "クルル", "はっ！　ヒーローさんから\nお代なんて頂けないです！\nどうぞどうぞ…え、ダメ？");
INSERT INTO `v1_d51f6b26fe39713f2fec67fb35da243a29c9c10b1b4254b84c6bfa3fc19547d3` VALUES ("2025/09/16 15:00:00", 137701, 2, 5.549, 0.0, -470.0, 2002, 10040, 1, "2025/12/23 14:59:59", 1, 10, "ヴォルガーノ", "よぅ！　今日の俺さまは\n門番じゃなく、店番だぜ\nメモピ～スフィア～てな！");
INSERT INTO `v1_d51f6b26fe39713f2fec67fb35da243a29c9c10b1b4254b84c6bfa3fc19547d3` VALUES ("2025/09/16 15:00:00", 137701, 3, 2.64, 0.0, -470.0, 2002, 10041, 2, "2025/12/23 14:59:59", 6, 10, "ヴォルガーノ", "…リマさんのブロマイド？\n買い取るに決まってらぁ！\nなんでも持ってけ泥棒っ！");
